INSERT INTO `halaman` (`id`, `judul`, `slug`, `isi`, `aktif`) VALUES
(1, 'Sejarah Kota Kendari', 'sejarah-kota-kendari', '<p>Sejak dahulu Teluk Kendari telah dikenal oleh pelaut-pelaut nusantara maupun eropa sebagai jalur persinggahan perdagangan laut dari dan menuju Ternate atau Maluku. Pada Kartografi Portugis kuno awal abad ke-15 telah menunjukkan adanya perkampungan di Pantai Timur Celebes atau Sulawesi yang dinamakan <em>Citta dela Baia</em> di pesisir teluk bernama <em>Baia du Tivora</em> yang identik dengan Teluk Kendari. Dalam sastra lisan tua suku Tolaki, wilayah Teluk Kendari disebut dengan nama <em>Lipu I Pambandahi</em>, Wonua <em>I Pambandokooha</em> yang merupakan salah satu daerah di pesisir timur Kerajaan Konawe.</p><p>Pada tahun 1828, seorang pelaut bernama Jacques Nicholas Vosmaer mendapat tugas dari Gubernur Jenderal Hindia Belanda untuk melakukan observasi terhadap jalur perdagangan di pesisir timur Sulawesi. Peta pertama Teluk Kendari di buat pada 9 Mei 1831 dan sejak 6 Februari 1835 teluk Kendari disebut sebagai <em>Vosmaers Baai</em> atau Teluk Vosmaer melalui Surat Keputusan Jenderal Van Den Bosch di Batavia. Dalam catatan perjalanannya yang berjudul <em>Korte Beschrijving van het zuid oostelijk schiereiland van Celebes,</em> Vosmaer menuliskan tertarik akan keindahan Teluk Kendari, setelah mendapat izin dari Tebau sebagai penguasa wilayah timur Kerajaan Konawe pada tahun 1932, Vosmaer kemudian mendirikan kantor dagang dan membuatkan istana Tebau dari Lepo-Lepo ke Teluk Kendari. hal inilah yang merupakan titik tolak perkembangan Kendari menjadi kota pusat pemerintahan dan perdagangan.</p><p>Penamaan Kendari sendiri berasal dari kata Kandai yaitu alat dari bambu atau kayu yang dipergunakan penduduk teluk Kendari untuk mendorong perahu, dari kata Kandai inilah kemudian diabadikan menjadi kampung Kandai dan pengembangan dari kata Kandai selanjutnya dalam berbagai literature terakhir disebut Kendari.</p><p>Pada masa pemerintahan kolonial Belanda dan pendudukan Jepang, Kendari yang hanya seluas  31,40 km2 saat itu, adalah wilayah Kewedanaan sekaligus Ibu kota <em>Onder Afdeling</em> atau <em>Bun Ken Laiwoi</em>. Kendari berubah dari ibukota kecamatan kemudian berkembang menjadi ibukota Kabupaten Daerah Tingkat II berdasarkan Undang-undang Nomor 29 Tahun 1959.</p><p>Penerbitan Perpu Nomor 2 Tahun 1964 Jo. Undang-undang Nomor&nbsp; &nbsp; &nbsp; 13 Tahun 1964, menandai ditetapkannya Kendari sebagai Ibukota Provinsi Sulawesi Tenggara yang masih terdiri dari dua wilayah kecamatan, yakni Kecamatan Kendari dan Kecamatan Mandonga dengan pertambahan luas wilayah  75,76 km2. Kemudian Peraturan Pemerintah Nomor 19 Tahun 1978 mengubah status Kendari menjadi Kota Administratif yang meliputi tiga wilayah kecamatan, yakni Kecamatan Kendari, Mandonga dan Poasia dengan 24 desa.</p><p>Seiring dengan pertumbuhan dan perkembangan Kota Kendari, maka dikeluarkanlah Undang-undang nomor 6 tahun 1995 yang menetapkan Kota Kendari sebagai Kota Madya Daerah Tingkat II dengan luas wilayah298,89 km2 atau 0,7 persen dari luas wilayah daratan Sulawesi Tenggara.</p><p>Selama terbentuknya Kota Administratif Kendari, Kota Kendari berturut-turut dipimpin oleh :</p><ul><li>H. Mansyur Pamadeng (1978-1979);</li><li>Drs. H. Muhammad Antero Hamra (1980-1985);</li><li>Drs. H. Anas Bunggasi (1985-1987);</li><li>Kolonel Adi Mangilep (selaku Pelaksana Tugas tahun 1988-1991);</li><li>Drs. H. Andi Kaharuddin (selaku Pelaksana Tugas tahun 1991-1992);</li><li>Drs. H. Usman Sabara (selaku Pelaksana Tugas tahun 1993-1993);</li><li>Drs. H. La Ode Muhammad Salihin Sabora (1993-1995); dan</li><li>Kolonel A. Razid Hamzah (selaku Pelaksana Tugas tahun 1995-1995).</li></ul><p>Kendari sebagai daerah otonom berturut-turut dipimpin oleh :</p><ul><li>Drs. Lasjkar Koedoes (selaku Pejabat Walikota tahun 1995-1996);</li><li>Drs. H. Masyhur Masie Abunawas (1996-2001);</li><li>Drs. H. Andi Kaharuddin (selaku Pejabat Walikota tahun 2001-2002);</li><li>Drs. H. Masyhur Abunawas M.Si. dan wakilnya Ir. Andi Muzakkir Mustafa, MM. (2002-2007);</li><li>Dr. Ir. H. Asrun, M.Eng.,Sc. dan wakilnya H. Musadar Mappasomba, SP.,MP. periode pertama (2007-2012) dan periode kedua (2012-2017);</li><li>Adriatma Dwi Putra, ST. dan&nbsp; wakilnya H. Sulkarnain K, SE.,ME.(2017-2022);serta</li><li>H. Sulkarnain K, SE., ME. dan&nbsp; wakilnya dr. Hj. Siska Karina Imran, SKM periode 2017-2022.</li></ul>', '1'),
(2, 'Visi Misi', 'visi-misi', '<p><strong>Menciptakan Kota Kendari yang Aman, Nyaman dan Bahagia</strong><br>&nbsp;</p>', '1');

