INSERT INTO `ppid` (`id`, `label`, `slug`, `icon`, `konten`, `lampiran`) VALUES
(1, 'Gambaran Singkat Pembentukan PPID', 'gambaran-singkat', 'BookOpen', '<p>PPID adalah kepanjangan dari Pejabat Pengelola Informasi dan Dokumentasi, dimana PPID berfungsi sebagai pengelola dan penyampai dokumen yang dimiliki oleh badan publik sesuai dengan amanat Undang-Undang Nomor 14 tahun 2008 tentang Keterbukaan Informasi Publik. Dengan keberadaan PPID maka masyarakat yang akan menyampaikan permohonan informasi lebih mudah dan tidak berbelit karena dilayani lewat satu pintu.</p><p>Pejabat Pengelola Informasi dan Dokumentasi (PPID) adalah pejabat yang bertanggung jawab dibidang penyimpanan, pendokumentasian, penyediaan, dan/atau pelayanan informasi di badan publik.&nbsp;</p><p>Pejabat Pengelola Informasi dan Dokumentasi Pelaksana (PPID Pelaksana) adalah pejabat yang melaksanakan tugas dan fungsi sebagai PPID pada satuan Organisasi Perangkat Daerah (OPD) di lingkungan pemerintah daerah.&nbsp;</p><p>Pembentukan PPID di Kota Kendari merupakan pelaksanaan kebijakan pemerintah di bidang komunikasi dan informatika, khususnya sejak ditetapkannya Undang-Undang No. 14 Tahun 2008 Tentang Keterbukaan Informasi Publik (KIP), yang kemudian diikuti dengan terbitnya Peraturan Pemerintah Republik Indonesia No. 61 Tahun 2010 Tentang Pelaksanaan UU No. 14 Tahun 2008 Tentang KIP dan Peraturan Menteri Dalam Negeri No. 3 Tahun 2017 Tentang Pedoman Pengelolaan Pelayanan Informasi dan Dokumentasi di Lingkungan Kement erian Dalam Negeri dan Pemerintahan Daerah.&nbsp;</p><p>PPID Kota Kendari dibentuk untuk pertama pada tahun 2019 sejak terbentuknya Dinas Komunikasi dan Informatika Kota Kendari dibantu oleh PPID Pelaksana yaitu Pejabat Pengelola Informasi dan Dokumentasi di tingkat Perangkat Daerah, yaitu Badan, Dinas, Bagian, dan Kecamatan di lingkungan Pemerintah Kota Kendari.</p>', 'dokumen-ppid/GAMBARAN SINGKAT PEMBENTUKAN PPID_20250829_133216.pdf'),
(2, 'Visi dan Misi', 'visi-dan-misi', 'Target', '<h3><strong>Visi</strong></h3><p>Mewujudkan pelayanan informasi yang transparan dan akuntabel, sehingga dapat memenuhi hak masyarakat dalam mengakses informasi publik sesuai dengan ketentuan peraturan perundang-undangan dengan mekanisme yang cepat, tepat, sederhana, dan mudah dijangkau oleh masyarakat.</p><h3><strong>Misi</strong></h3><ol><li>Meningkatkan pengelolaan dan pelayanan informasi yang berkualitas, akurat, dan dapat dipercaya.&nbsp;</li><li>Mengembangkan sistem penyediaan dan pelayanan informasi yang terintegrasi dan mudah diakses.&nbsp;</li><li>Meningkatkan kompetensi sumber daya manusia yang berkualitas di bidang pelayanan informasi publik.</li></ol>', 'dokumen-ppid/Visi dan Misi PPID_20250829_133856.pdf'),
(3, 'Profil', 'profil', 'User', '<p>Keterbukaan Informasi Publik merupakan aspek yang penting dalam rangka mewujudkan penyelenggaraan negara yang transparan. Oleh karena itu adalah hak publik untuk memperoleh Informasi sesuai dengan peraturan perundang-undangan. Hak atas Informasi. Hak setiap Orang untuk memperoleh Informasi juga relevan untuk meningkatkan keterlibatan masyarakat dalam proses pengambilan keputusan publik. Partisipasi masyarakat dapat terlaksana apabila adanya jaminan akan Keterbukaan Informasi Publik.</p><p>Keberadaan Undang-Undang tentang Keterbukaan Informasi Publik sangat penting sebagai landasan hukum yang berkaitan dengan:</p><ol><li>hak setiap Orang untuk memperoleh Informasi;</li><li>kewajiban Badan Publik menyediakan dan melayani permintaan Informasi secara cepat, tepat waktu, biaya ringan/proporsional, dan cara sederhana;</li><li>pengecualian bersifat ketat dan terbatas;</li><li>kewajiban Badan Publik untuk membenahi sistem dokumentasi dan pelayanan Informasi.</li></ol><p>Atas dasar pemikiran tersebut, maka Pemerintah Kota Kendari membentuk Pejabat Pengelola Informasi dan Dokumentasi Kota Kendari sebagaimana tertuang dalam Peraturan Wali Kota Kendari Nomor 43 Tahun 2023 Tentang Pedoman Pengelolaan Pelayanan Informasi dan Dokumentasi di Lingkungan Pemerintah Daerah Kota Kendari yang mana mangatur tata kerja, tata cara pengelolaan dan pelayanan informasi dan dokumentasi oleh Pejabat Pengelola Informasi dan Dokumentasi Pemerintah Kota Kendari.&nbsp;</p><p>Pejabat Pengelola Informasi dan Dokumentasi (PPID) adalah pejabat yang bertanggung jawab di bidang penyimpanan, pendokumentasian, penyediaan, dan/atau pelayanan informasi di badan publik.</p><p>PPID ini berfungsi sebagai pengelola dan penyampai dokumen yang dimiliki oleh badan publik sesuai amanat Undang-Undang Nomor 14 Tahun 2008 tentang Keterbukaan Informasi Publik. Dengan keberadaan PPID, akan mempermudah masyarakat yang akan menyampaikan permohonan informasi karena tidak berbelit dan dilayani melalui satu pintu.&nbsp;</p><p>Sebagai Badan Publik, sesuai dengan Pasal 7 Undang-Undang Nomor 14 Tahun 2008 tentang Keterbukaan Informasi Publik, Dinas Komunikasi dan Informatika Kota Kendari memiliki kewajiban :</p><ol><li>Menyediakan, memberikan dan/atau menerbitkan informasi publik yang berada di bawah kewenangannya kepada Pemohon Informasi Publik, selain informasi yang dikecualikan sesuai dengan ketentuan;&nbsp;</li><li>Menyediakan informasi publik yang akurat, benar, dan tidak menyesatkan;&nbsp;</li><li>Untuk melaksanakan kewajiban sebagaimana dimaksud pada angka 2, Badan Publik harus membangun dan mengembangkan sistem informasi dan dokumentasi untuk mengelola informasi publik secara baik dan efisien sehingga dapat diakses dengan mudah;&nbsp;</li><li>Badan Publik wajib membuat pertimbangan secara tertulis setiap kebijakan yang diambil untuk memenuhi hak setiap orang atas Informasi Publik;&nbsp;</li><li>Pertimbangan sebagaimana dimaksud pada angka 4, antara lain memuat pertimbangan politik, ekonomi, sosial, budaya, dan/atau pertahanan dan keamanan negara;&nbsp;</li><li>Dalam rangka memenuhi kewajiban sebagaimana dimaksud pada angka 1 sampai dengan angka 4, Badan Publik dapat memanfaatkan sarana dan/atau media elektronik dan non elektronik.</li></ol>', 'dokumen-ppid/Profil PPID_20250829_134258.pdf'),
(4, 'Struktur PPID', 'struktur', 'Layers', '<p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image/png&quot;,&quot;filename&quot;:&quot;image.png&quot;,&quot;filesize&quot;:161436,&quot;height&quot;:543,&quot;href&quot;:&quot;http://127.0.0.1:8002/storage/richeditor/VwHHlAcprpSHsxpkVzAxtr2ep7k1gEnHd1M2mxHX.png&quot;,&quot;url&quot;:&quot;http://127.0.0.1:8002/storage/richeditor/VwHHlAcprpSHsxpkVzAxtr2ep7k1gEnHd1M2mxHX.png&quot;,&quot;width&quot;:606}\" data-trix-content-type=\"image/png\" data-trix-attributes=\"{&quot;caption&quot;:&quot;Struktur Organisasi PPID Kota Kendari&quot;,&quot;presentation&quot;:&quot;gallery&quot;}\" class=\"attachment attachment--preview attachment--png\"><a href=\"http://127.0.0.1:8002/storage/richeditor/VwHHlAcprpSHsxpkVzAxtr2ep7k1gEnHd1M2mxHX.png\"><img src=\"http://127.0.0.1:8002/storage/richeditor/VwHHlAcprpSHsxpkVzAxtr2ep7k1gEnHd1M2mxHX.png\" width=\"606\" height=\"543\"><figcaption class=\"attachment__caption attachment__caption--edited\">Struktur Organisasi PPID Kota Kendari</figcaption></a></figure></p>', 'dokumen-ppid/Struktur PPID_20250829_134838.pdf'),
(5, 'Maklumat Pelayanan Informasi Publik', 'maklumat', 'Megaphone', '<p>PPID menyatakan komitmen untuk:</p><ol><li>Memberikan Informasi Publik sesuai dengan Undang-Undang Nomor 14 Tahun 2008 tentang Keterbukaan Informasi Publik;&nbsp;</li><li>Menyediakan Informasi Publik yang akurat, benar, dan tidak menyesatkan;&nbsp;</li><li>Memberikan layanan informasi dan memanfaatkan Teknologi Informasi yang mudah diakses masyarakat;&nbsp;</li><li>Tidak melakukan pungutan yang tidak sah dalam memberikan layanan Informasi Publik.</li></ol>', 'dokumen-ppid/Maklumat Pelayanan Informasi Publik_20250902_132829.pdf'),
(6, 'Tanggungjawab, Tugas, dan Wewenang', 'tugas-dan-tanggungjawab', 'ClipboardList', '<p>Berdasarkan Peraturan Wali Kota Kendari Nomor 43 Tahun 2023 tentang Pedoman Pengelolaan Pelayanan Informasi dan Dokumentasi di Lingkungan Pemerintah Daerah Kota Kendari:</p><h3>A. Tanggungjawab</h3><ul><li>PPID, bertanggung jawab melaksanakan layanan informasi publik yang meliputi proses penyimpanan, pendokumentasian, Penyediaan dan pelayanan informasi publik di lingkungan Pemerintah Kota Kendari.</li><li>PPID Pelaksana, bertanggung jawab membantu pelaksanaan layanan informasi publik yang meliputi proses penyimpanan, pendokumentasian, penyediaan dan pelayanan informasi publik di masing- masing perangkat daerah.</li></ul><h3>B. Tugas</h3><p><strong>PPID</strong></p><ol><li>menyusun dan melaksanakan kebijakan informasi dan dokumentasi;</li><li>menyusun laporan pelaksanaan kebijakan informasi dan dokumentasi;&nbsp;</li><li>mengkoordinasikan dan mengkonsolidasikan pengumpulan bahan informasi dan dokumentasi dari PPID Pelaksana;&nbsp;</li><li>menyimpan, mendokumentasikan, menyediakan, dan memberi pelayanan informasi dan dokumentasi kepada publik;&nbsp;</li><li>melakukan verifikasi bahan informasi dan dokumentasi publik;&nbsp;</li><li>melakukan uji konsekuensi atas informasi dan dokumentasi yang dikecualikan;&nbsp;</li><li>melakukan pemutakhiran informasi dan dokumentasi; dan&nbsp;</li><li>menyediakan informasi dan dokumentasi untuk diakses oleh masyarakat.</li></ol><p><strong>PPID Pelaksana</strong></p><ol><li>membantu PPID melaksanakan tanggung jawab, tugas dan kewenangannya;&nbsp;</li><li>menyampaikan informasi dan dokumentasi kepada PPID dilakukan paling sedikit 6 (enam) bulan sekali atau sesuai kebutuhan;&nbsp;</li><li>melaksanakan kebijakan teknis informasi dan dokumentasi sesuai dengan tugas pokok dan fungsinya;&nbsp;</li><li>menjamin ketersediaan dan akselerasi layanan informasi dan dokumentasi bagi pemohon informasi secara cepat, tepat, berkualitas dengan mengedepankan prinsip-prinsip pelayanan prima;</li><li>mengumpulkan, mengolah dan mengoptimalkan bahan dan lingkup komponen di Lingkungan Kementerian Dalam Negeri atau Perangkat Daerah di Lingkungan Pemerintah Daerah masing-masing menjadi bahan informasi publik; dan&nbsp;</li><li>menyampaikan laporan pelaksanaan kebijakan teknis dan pelayanan informasi dan dokumentasi kepada PPID secara berkala dan sesuai kebutuhan.</li></ol><h3>C. Wewenang</h3><p><strong>PPID</strong></p><ol><li>menolak memberikan informasi dan dokumentasi yang dikecualikan sesuai dengan ketentuan peraturan perundang-undangan;&nbsp;</li><li>meminta dan memperoleh informasi dan dokumentasi dari PPID Pembantu yang menjadi cakupan kerjanya;&nbsp;</li><li>mengkoordinasikan pemberian pelayanan informasi dan dokumentasi dengan PPID Pembantu yang menjadi cakupan kerjanya;&nbsp;</li><li>menentukan atau menetapkan suatu informasi dan dokumentasi yang dapat diakses oleh publik; dan&nbsp;</li><li>menugaskan PPID Pembantu dan/atau Pejabat Fungsional untuk membuat, mengumpulkan, serta memelihara informasi dan dokumentasi untuk kebutuhan organisasi.</li></ol><p><strong>PPID Pelaksana</strong></p><ol><li>Meminta dokumen informasi publik dari petugas pelayanan informasi publik pada PD sesuai dengan lingkup tugasnya;&nbsp;</li><li>Meminta klarifikasi kepada petugas pelayanan informasi publik pada PD sesuai dengan lingkup tugasnya dalam melaksanakan pelayanan informasi publik;&nbsp;</li><li>Menetapkan daftar informasi publik yang telah dimutakhirkan; dan&nbsp;</li><li>Menugaskan petugas pelayanan informasi publik pada PD dalam penyiapan dokumen untuk membantu PPID melaksanakan Pengujian Konsekuensi atas informasi publik yang akan dikecualikan, pembuatan pertimbangan tertulis dalam hal suatu informasi publik dikecualikan, dan/atau permintaan informasi publik ditolak.</li></ol>', 'dokumen-ppid/Tanggung Jawab, Tugas, dan Wewenang PPID_20250829_135213.pdf');

